s Kunde, so dass Sie Module und Updates selbst auf eigenem Server installieren können.<br/>\r\n<br/>\r\n§ 3 Geltungsbereich<br/>\r\n3.1\tDiese Nutzungsbedingungen regeln das Vertragsverhältnis zwischen der OpenZ GmbH und Ihnen als Nutzer der Software.<br/>\r\n3.2 Das Angebot der OpenZ-Software richtet sich ausschließlich an Unternehmer und Unternehmen, dagegen nicht an Verbraucher i.S.d. § 13 BGB.<br/>\r\n<br/>\r\n§4 Vertragsdurchführung<br/>\r\n4.1 Die Nutzung des vorliegenden OpenZ-Community Systems ist auf 2 Nutzer beschränkt.<br/>\r\n4.2 OpenZ-Community kann ggf. Werbung enthalten. <br/>\r\n4.3 Es besteht in OpenZ-Community keine Möglichkeit Erweiterungen als Module hinzuzuinstallieren oder ein Update auf die jeweils aktuelle Version der OpenZ-Software durchzuführen.<br/>\r\n<br/>\r\n§ 5 Lizenzmodell<br/>\r\n5.1 Die OpenZ-Software unterliegt der Mozilla Public License (<a href="http://www.mozilla.org/MPL/MPL-1.1.html" title="MPL V 1.1">MPL V 1.1</a>) von der Mozilla Foundation.<br/>\r\n5.2 Teile der Software, wie etwa benutzte Bibliotheken, unterliegen auch anderen Open Source Software Lizenzen. <br/>\r\n5.3 Teile der OpenZ-Software unterliegen auch der Openbravo Public License, welche eine genaue Kopie der Mozilla Public License 1.1 ist, mit dem einzigen Zusatz, das Openbravo-Logo nebst Link auf die URL openbravo.com in der oberen Bildschirmecke anzuzeigen. <br/>\r\n5.4 Eine genaue Erläuterung der Lizenzen finden Sie in der Software-Distribution von OpenZ, die mit jedem System ausgeliefert wird im Ordner: ~/openz/legal/.<br/>\r\n<br/>\r\n<br/>\r\n§ 6 Statistische Daten<br/>\r\nDie OpenZ-Software überträgt in regelmäßigen Abständen anonymisierte Statistische Daten an den Server der OpenZ GmbH.<br/>\r\nDiese Daten werden von der OpenZ GmbH genutzt um die OpenZ-Software und Ihre Services zu verbessern.<br/>\r\nKonkret werden anonym pro Modul die Nutzungsdaten, also die Anzahl der Datensätze in den einzelnen Modulen übertragen.<br/>\r\nDiese Daten sind nicht mehr a